import React, { useState } from 'react';
import axios from 'axios';
import './Register.css';

const jobTitles = [
    'CEO',
    'CFO',
    'COO',
    'CTO',
    'CIO',
    'VICE_PRESIDENT',
    'SENIOR_MANAGER',
    'MANAGER',
    'TEAM_LEAD',
    'SOFTWARE_ENGINEER',
    'JUNIOR_ENGINEER',
    'INTERN'
];

const Register = () => {
    const [firstname, setFirstname] = useState('');
    const [lastname, setLastname] = useState('');
    const [username, setUsername] = useState('');
    const [jobTitle, setJobTitle] = useState('');
    const [mobile, setMobile] = useState('');
    const [location, setLocation] = useState('');
    const [password, setPassword] = useState('');
    const [message, setMessage] = useState('');

    const handleRegister = async (event) => {
        event.preventDefault();

        if (!firstname.trim()) {
            setMessage('Please fill in all required fields.');
        }

        if (!lastname.trim()) {
            setMessage('Please fill in all required fields.');
        }
        if (!username.trim()) {
            setMessage('Please fill in all required fields.');
        }
        if (!jobTitle.trim()) {
            setMessage('Please fill in all required fields.');
        }
        if (!mobile.trim()) {
            setMessage('Please fill in all required fields.');
        }
        // Check for empty fields
        //    // if (!firstname.trim() || !lastname.trim() || !username.trim() || !jobTitle.trim() || !mobile.trim()) {
        //         setMessage('Please fill in all required fields.');
        //         return;
        //     }

        try {
            const response = await axios.post('http://localhost:8081/api/register', {
                firstName: firstname,  // Adjusted to match backend field names
                lastName: lastname,
                username,
                titleName: jobTitle,  // Adjusted to match backend field names
                mobileNumber: mobile,  // Adjusted to match backend field names
                location,
                password,
            }, {
                headers: {
                    'Content-Type': 'application/json',
                },
            });
            setMessage(response.data.message);
        } catch (error) {
            if (error.response) {
                console.error('Error response from server:', error.response.data);
                setMessage('Error registering user: ' + JSON.stringify(error.response.data));
            } else {
                console.error('Error during request:', error.message);
                setMessage('Error registering user.');
            }
        }
    };

    return (
        <div className="main">
            <h2 className="header">Register</h2>

            <label>Enter Firstname<span className='star'>
                *</span></label>
            <input
                type="text"
                placeholder="firstname"
                value={firstname} required
                onChange={(e) => setFirstname(e.target.value)}
                className="input"
            />

            <label>Enter Lastname<span className='star'>
                *</span></label>
            <input
                type="text"
                placeholder="lastname"
                value={lastname} required
                onChange={(e) => setLastname(e.target.value)}
                className="input"
            />

            <label>Enter Username<span className='star'>
                *</span></label>
            <input
                type="text"
                placeholder="username"
                value={username} required
                onChange={(e) => setUsername(e.target.value)}
                className="input"
            />

            <label htmlFor="jobTitle">Job Title:<span className='star'>
                *</span></label>
            <select
                id="jobTitle"
                value={jobTitle}
                onChange={(e) => setJobTitle(e.target.value)}
                className="input"
            >
                <option value="" disabled>Select a job title</option>
                {jobTitles.map((title, index) => (
                    <option key={index} value={title}>
                        {title}
                    </option>
                ))}
            </select>

            <label>Mobile number<span className='star'>
                *</span></label>
            <input
                type="text"  // Changed to text to match validation
                placeholder="Enter mobile number"
                value={mobile} required
                onChange={(e) => setMobile(e.target.value)}
                className="input"
            />

            <label>Location<span className='star'>
                *</span></label>
            <input
                type="text"
                placeholder="Enter Current location"
                value={location}
                onChange={(e) => setLocation(e.target.value)}
                className="input"
            />

            <label>Password<span className='star'>
                *</span></label>
            <input
                type="password"
                placeholder="Password"
                value={password} required
                onChange={(e) => setPassword(e.target.value)}
                className="input"
            />

            <button onClick={handleRegister} className="btn">Register</button>

            {message && <p className="message">{message}</p>}

            <span className="text-sm">
                Already have an account?{' '}
                <a href="/login" className="text-blue-500 hover:text-blue-600">Login</a>
            </span>
        </div>
    );
};

export default Register;
